import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";

const Calendar = () => {
  <div class="container text-center">
    <div class="row">
      <div class="col-8">
        Calendar
      </div>
      <div class="col-4">
        Timer
      </div>
    </div>
  </div>
};

export default Calendar;
